				<footer>
					<p>
						Copyright © 2023{" "}
						<a
							href="https://github.com/itsMe-ThatOneGuy"
							target="_blank"
							rel="noreferrer">
							itsMe-ThatOneGuy
						</a>
					</p>
				</footer>
			</div>
		);
	}
}

export default App;
